import React from 'react'
import Product from './Product'

function BeeHiveKits() {
    return (
        <div className='store__frames'>
            <Product
                id='9'
                title='Regał wielkopolski gniazdowy'
                image='https://scontent.fpoz3-1.fna.fbcdn.net/v/t1.15752-9/s2048x2048/120298161_2676047939327748_345234343474428542_n.jpg?_nc_cat=102&_nc_sid=b96e70&_nc_ohc=Em-TUoIRtMIAX-n-YmI&_nc_ht=scontent.fpoz3-1.fna&tp=7&oh=7cf4d5989cdf2240b9bc666892fd2fd0&oe=5F9734A8'
                price={35}
                availble={true}
            />
            <Product
                id='10'
                title='Regał warszawski zwykły'
                image='https://scontent.fpoz3-1.fna.fbcdn.net/v/t1.15752-9/s2048x2048/120298161_2676047939327748_345234343474428542_n.jpg?_nc_cat=102&_nc_sid=b96e70&_nc_ohc=Em-TUoIRtMIAX-n-YmI&_nc_ht=scontent.fpoz3-1.fna&tp=7&oh=7cf4d5989cdf2240b9bc666892fd2fd0&oe=5F9734A8'
                price={38}
                availble={false}
            />



            <Product
                id='11'
                title='Regał warszawski poszerzany'
                image='https://scontent.fpoz3-1.fna.fbcdn.net/v/t1.15752-9/s2048x2048/120298161_2676047939327748_345234343474428542_n.jpg?_nc_cat=102&_nc_sid=b96e70&_nc_ohc=Em-TUoIRtMIAX-n-YmI&_nc_ht=scontent.fpoz3-1.fna&tp=7&oh=7cf4d5989cdf2240b9bc666892fd2fd0&oe=5F9734A8'
                price={38}
                availble={false}
            />
            <Product
                id='12'
                title='Regał dadant gniazdowy'
                image='https://scontent.fpoz3-1.fna.fbcdn.net/v/t1.15752-9/s2048x2048/120298161_2676047939327748_345234343474428542_n.jpg?_nc_cat=102&_nc_sid=b96e70&_nc_ohc=Em-TUoIRtMIAX-n-YmI&_nc_ht=scontent.fpoz3-1.fna&tp=7&oh=7cf4d5989cdf2240b9bc666892fd2fd0&oe=5F9734A8'
                price={38}
                availble={false}
            />
        </div>
    )
}

export default BeeHiveKits
